import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation

export const PropertyList = () => {
  const properties = [
    { id: 1, image: 'img/01-small.jpg', title: 'Property 1' }, // Correct image path
    { id: 2, image: 'img/ff1.jpg', title: 'Property 2' },
    { id: 3, image: 'img/ff2.jpg', title: 'Property 3' },
    { id: 4, image: 'img/ff3.jpg', title: 'Property 4' },
    { id: 5, image: 'img/ff4.jpg', title: 'Property 5' },
    { id: 6, image: 'img/ff5.jpg', title: 'Property 6' },
  ];

  return (
    <div className="property-list">
      {properties.map((property) => (
        <div key={property.id} className="property-item">
          <img 
            src={property.image || '/img/default-image.jpg'} // Fallback image if none exists
            alt={property.title} 
            className="property-image" 
          />
          <div className="hover-overlay">
            <Link to={`/property/${property.id}`} className="explore-btn"> {/* Add Link to property detail */}
              Explore
            </Link>
          </div>
        </div>
      ))}
    </div>
  );
};

export default PropertyList;
